import {
  Theme,
  createStyles
} from "@material-ui/core/styles";

const styles = (theme: Theme) => createStyles({
  activityContainer: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
  },
  activityTitle: {
    fontWeight: 'bold'
  },
  btnAdd: {
    textTransform: 'capitalize',
  },
  dialog: {
    "& .MuiPaper-root": {
      maxWidth: 550
    }
  }
})

export default styles
